import React from 'react'

const Product = ({name,id,imgUrl,price}) => {
  return (
    <div>
       <h2>Product</h2>
       <img src={imgUrl} alt={name}/>
       <h2>{name}</h2>
       <p>{price}</p>
       <button>Add TO Cart</button>
    </div>
  )
}

export default Product
